import React, { Component } from 'react';
import Nav from './components/Nav'
import NotFound from './components/NotFound'
import './index.css';

import {
  BrowserRouter,
  Route,
  Switch
} from 'react-router-dom';

import apiKey from './config'

class App extends Component {

  constructor() {
    super();
    this.state = {
      photos: []
    };
  }

  componentDidMount() {
      fetch('https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=1f8da2e2e56688eb397b68debe319f86&tags=waterfalls&per_page=24&format=json&nojsoncallback=1')
      .then(response => response.json())
      .then(responseData => {
        this.setState({ photos: responseData.data})
      })
      .catch(error => {
        console.log('Error fetching and parsing data', error)

      })
  }

  render() {
    return (
      console.log(this.state.photos),

    <BrowserRouter>
      <div class="container">

        <Switch>
          <Route path="/waterfalls" component={Nav}/>
          <Route path="/dogs" component={Nav}/>
          <Route path="/desert" component={Nav}/>
          <Route component={NotFound}/>
          </Switch>
          </div>
    </BrowserRouter>
  );
}
}

export default App;
